create table tbl_task
(
    id                 bigint                     not null comment '主键'
        primary key,
    owner_id           bigint                     null comment '品牌商id',
    task_name          varchar(60)                null comment '任务名称',
    cooperation_model  int(10)          default 1 null comment '合作模式： 1: 纯佣金模式 2: 佣金加坑位费',
    commission_percent decimal(8, 2)              null comment '佣金比例',
    budget             decimal(8, 2)              null comment '预算金额',
    task_desc          varchar(255)               null comment '任务描述',
    earnest_money      decimal(8, 2)              null comment '保证金额度',
    task_status        int(10)          default 1 null comment '任务状态 1: 发布中 2: 待承接 3:发布失败4: 履约中 5: 已完成 ',
    auditor_admin_id   bigint                     null comment '审核人id(管理员)',
    create_time        datetime                   null comment '创建时间',
    modified_time      datetime                   null comment '修改时间',
    deleted            tinyint unsigned default 0 null comment '逻辑删除标识（0为否，1为是）'
)
    comment '任务表';

